import React from "react";


const tableCell = "w-1/3 inline";
const tableRow = "w-full flex";

function ExpenseTable({ expenses }) {
    return (
        <section>
            <div className={tableRow + " font-bold"}>
                <div className={tableCell}>Name</div>
                <div className={tableCell}>Cost</div>
                <div className={tableCell}>Category</div>
            </div>
            {
                expenses.map(
                    (e, i) => (
                    <div key={i} className={tableRow}>
                        <div className={tableCell}>{e.name}</div>
                        <div className={tableCell}>{e.cost}</div>
                        <div className={tableCell}>{e.category}</div>
                    </div>)
                )
            }
        </section>
    )
}

export default ExpenseTable;
